import React, { useState } from 'react';
import useReactRouter from 'use-react-router';
import { useDispatch } from "react-redux";
import pageActionModule, { usePageAction } from "../modules/pageActionModule";
import { login } from '../modules/api';
import { Typography, makeStyles, TextField, Grid, Box, Button } from '@material-ui/core'
import InputBase from "@material-ui/core/InputBase";
import IconButton from "@material-ui/core/IconButton";
import ForwardIcon from "@material-ui/icons/Forward";
import ContactMailIcon from '@material-ui/icons/ContactMail';
const Frame = require('../assets/decorativeframe2.png');

const selectButtonRadius = '8px';
const textInputBgColor = '#fefffe';
const useStyles = makeStyles((theme) => ({
  startText: {
    backgroundColor: "#EFEDE9",
    fontSize: "15px",
    color: "#4575B4",
    width: "100%",
    maxWidth: '390px',
    position: 'relative',
    fontFamily: "メイリオ",
    paddingBottom: "1rem",
    '& .MuiSvgIcon-root': {
        fontSize: 'inherit',
    }
  },
  selectButton: {
    width: "100%",
    minHeight: '10%',
    // height: '10%',
    justifyItems: 'center',
    textAlign: 'center',
    padding: '0.5rem 0',
    position: 'relative',
    // bottom: "10%",
    backgroundColor: '#EFEDE9',
  },
  passwordForgotContainer: {
    display: 'flex',
    justifyContent: "center",
    alignItems: 'center',
    width: '100%',
    padding: '1.5rem 1rem',
  },
  passwordForgotWrapper: {
    display: 'flex',
    justifyContent: "center",
    alignItems: 'center',
    flexDirection: 'column',
    width: '100%',
    // padding: '3rem 1rem',
  },
  sendButtonContainer: {
    display: 'flex',
    justifyContent: "center",
    alignItems: 'center',
    width: '100%',
    padding: '0 1rem 1rem',
  },
  sendButtonWrapper: {
    paddingLeft: '0.5rem',
    display: 'flex',
    alignItems: 'center',
    width: '100%',
    maxWidth: '390px',
    backgroundColor: textInputBgColor,
    border: '1px solid #c4c4c6',
    borderRadius: selectButtonRadius,
  },
  input: {
    marginLeft: theme.spacing(1),
    flex: 1,
  },
  iconButton: {
    padding: 10,
  },
  mailIcon: {
    marginBottom: '1.5rem',
    height: '50px',
    width: 'auto',
    color: '#4575b4',
    '& .MuiSvgIcon-root': {
      height: '50px',
      width: 'auto',
    }
  },
}))

const PasswordForgot: React.FC = () => {
  const classes = useStyles()
  const title = "選択式ミステリー旅行"
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const { history } = useReactRouter();
  const dispatch = useDispatch();
  const [securityCode, setSecurityCode] = useState('');
  const [errorMessage, setErrorMessage] = useState('');

  const resetPassword = async (event: React.MouseEvent<HTMLElement>) => {
    if (email) {
      fetch("https://jtb-prd.two-choices.jp/api/reset/", {//非同期処理
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ username: email })

      }).then(async (res: any) => {
        if (res.status === 200) {

          alert("入力されたメールアドレス宛にパスワードをお送りしました。このパスワードでログインしてください")
          history.push('/passwordConfirm')
        } else {

          setErrorMessage('通信でエラーが発生しました')
        }

      })
        .catch(error => { if (error.statusCode >= 400) setErrorMessage('通信でエラーが発生しました') })//同期処理


    } else {
      setErrorMessage('メールアドレスを入力してください');
    }

  }

  return (
    // <div className={classes.center_wrapper}>
    <div className={classes.passwordForgotContainer}>
      <div className={classes.passwordForgotWrapper}>
        <div className={classes.mailIcon}>
          <ContactMailIcon />
        </div>
        <div className={classes.startText}>
          パスワードをお忘れの方はこちらにメールアドレスを入力し、送信ボタン(<ForwardIcon />)を押してください
        </div>
        <div className={classes.selectButton}>
          <div className={classes.sendButtonContainer}>
            <div className={classes.sendButtonWrapper}>
              <InputBase
                className={classes.input}
                placeholder="メールアドレス"
                inputProps={{ 'aria-label': 'search google maps' }}
                onChange={e => setEmail(e.target.value)}
              />
              <IconButton
                type="submit"
                className={classes.iconButton}
                aria-label="search"
                onClick={(e) => resetPassword(e)}
              >
                <ForwardIcon />
              </IconButton>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}


export default PasswordForgot;
